description:
Bán Tòa nhà căn hộ KD dòng tiền ngõ 99 Xuân La diện tích 221m2, 8T, giá 69 tỷ
SIÊU PHẨM TÂY HỒ - TÒA NHÀ 8 TẦNG THANG MÁY + NỘI THẤT NHẬP KHẨU SETUP ĐẦY ĐỦ - CĂN HỘ DỊCH VỤ CAO CẤP 
Nhà xây mới, đẹp, hiện đại vừa ở vừa làm căn hộ dịch vụ cao cấp cho người nước ngoài thuê. Full nội thất hiện đại, nhập khẩu cao cấp. 
Gồm 2 khối nhà:
+ Khối mặt tiền 2 tầng cho thuê văn phòng công ty.
+ Khối nhà 8 tầng, gồm:
- Tầng 1: Gara nhiều ô tô + xe máy;
- Tầng 2: Phòng khách, Bếp ăn, phòng ngủ, WC;
- Tầng 3: 03 phòng ngủ, WC khép kín;
- Tầng 4,5,6 mỗi tầng 2 căn hộ cao cấp khép kín;
- Tầng 7: 01 căn hộ cao cấp khép kín. Sân vườn có thể cải tạo thành 1 căn hộ;
-  Tầng 8: Tum + Sân vườn có mái che trước sau rộng. 
Sổ đỏ chính chủ giao dịch ngay
Liên lạc em Hằng tư vấn xem nhà
